@namespace url(http://www.w3.org/1999/xhtml);
/* regular-expressions.info - Dark theme by Cookie338 */
/* version 1 released on: Sep 30, 2013 */

/* AGENT_SHEET */
@-moz-document domain("regular-expressions.info") {

body, .topad, .sidead {
    background: black !important;
    color: white !important
}

a {
    color: rgb(0,80,255) !important;
    background: none !important;
}

a:hover {
    color: rgb(255,102,0) !important
}

.regex, .match, .string {   
    color: white !important;
    background-color: rgb(50,50,50) !important;
}

.yes, .fail {
    color: black !important;
}

.reference, tr, th, td {
    border-color: gray !important;
}

#btntop > table:nth-child(1) > tbody:nth-child(1) > tr:nth-child(1) > td > a {
    color: white !important;
}

/*AD Block*/
.adsense, iframe {
    display: none !important;
}

}
